import React, { useState } from "react";
import Header from "../components/Header";

export default function Home() {
  const [menuList] = useState([
    "Profile",
    "Education",
    "Experience",
    "Contact",
  ]);

  return (
    <>
      <Header>{menuList}</Header>
      <h1>This is Home</h1>
    </>
  );
}
